    this.getDarkMode();
  },
  methods: {
		...mapActions('user', ['checkPassword', 'updateMember', 'signOut']),
    setDarkMode(mode) {
      this.$vuetify.theme.dark = mode;
      localStorage.setItem("darkMode", mode ? "dark" : "light");
    },
    getDarkMode() {
      const mode = localStorage.getItem("darkMode") === "dark" ? true : false;
      this.$vuetify.theme.dark = mode;
    },
    async openDialog() {
      this.dialog = true;
			return;
			// 소셜로그인 아니면 비밀번호를 확인
